import React from 'react';
import ReactDOM from 'react-dom';
import * as serviceWorker from './serviceWorker';
import {Form} from './components/index';

import {Lang} from './helper';

const forminit = {
    id: '',
    class: 'classname',
    method: 'get / post',
    action: '//',
    target: '_blank',
    token: '',
    hash: 'hash',
    inputs: [
        {name: 'name', value: Lang.common.next, default: ''},
        {name: 'work', type: 'textarea', value: '2018'},
        {
            name: 'select',
            type: 'select',
            default: '2',
            opts: [
                {desc: '0', disable: true},
                {desc: '1', value: '1'},
                {desc: '2', value: '2'},
            ],
        },
    ],
};

ReactDOM.render(<Form forminit={forminit} />, document.getElementById('app'));

serviceWorker.unregister();
